import React, { useState, useEffect } from 'react';
import api from '../../services/api';

const AnalyticsDashboard = () => {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAnalytics();
  }, []);

  const fetchAnalytics = async () => {
    try {
      const response = await api.get('/admin/dashboard');
      setAnalytics(response.data);
    } catch (error) {
      console.error('Error fetching analytics:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
        <p>Loading analytics...</p>
      </div>
    );
  }

  if (!analytics) {
    return (
      <div className="error-state">
        <h3>Failed to load analytics</h3>
        <p>Please try refreshing the page.</p>
      </div>
    );
  }

  const { stats } = analytics;

  // Calculate percentages for charts (mock data for demonstration)
  const instituteDistribution = [
    { category: 'Schools', count: 35, color: '#4361ee' },
    { category: 'Colleges', count: 25, color: '#7209b7' },
    { category: 'Coaching', count: 20, color: '#f72585' },
    { category: 'Preschools', count: 15, color: '#4cc9f0' },
    { category: 'Universities', count: 5, color: '#4895ef' }
  ];

  const ratingDistribution = [
    { rating: '5 Stars', count: 45, color: '#4cc9f0' },
    { rating: '4 Stars', count: 30, color: '#4895ef' },
    { rating: '3 Stars', count: 15, color: '#4361ee' },
    { rating: '2 Stars', count: 7, color: '#7209b7' },
    { rating: '1 Star', count: 3, color: '#f72585' }
  ];

  return (
    <div className="analytics-dashboard">
      <div className="section-header">
        <h2>Platform Analytics</h2>
        <p>Comprehensive overview of platform performance and metrics</p>
      </div>

      {/* Key Metrics */}
      <div className="metrics-grid">
        <div className="metric-card">
          <div className="metric-icon">üè´</div>
          <div className="metric-info">
            <div className="metric-number">{stats.totalInstitutes}</div>
            <div className="metric-label">Total Institutes</div>
          </div>
        </div>
        
        <div className="metric-card">
          <div className="metric-icon">üë•</div>
          <div className="metric-info">
            <div className="metric-number">{stats.totalUsers}</div>
            <div className="metric-label">Total Users</div>
          </div>
        </div>
        
        <div className="metric-card">
          <div className="metric-icon">‚≠ê</div>
          <div className="metric-info">
            <div className="metric-number">{stats.totalReviews}</div>
            <div className="metric-label">Total Reviews</div>
          </div>
        </div>
        
        <div className="metric-card">
          <div className="metric-icon">üìß</div>
          <div className="metric-info">
            <div className="metric-number">{stats.totalEnquiries}</div>
            <div className="metric-label">Total Enquiries</div>
          </div>
        </div>
        
        <div className="metric-card">
          <div className="metric-icon">‚è≥</div>
          <div className="metric-info">
            <div className="metric-number">{stats.pendingInstitutes}</div>
            <div className="metric-label">Pending Approvals</div>
          </div>
        </div>
      </div>

      {/* Charts Section */}
      <div className="charts-grid">
        <div className="chart-card">
          <h3>Institute Distribution by Category</h3>
          <div className="chart-container">
            {instituteDistribution.map((item, index) => (
              <div key={index} className="chart-item">
                <div className="chart-bar">
                  <div 
                    className="bar-fill"
                    style={{
                      width: `${item.count}%`,
                      backgroundColor: item.color
                    }}
                  ></div>
                </div>
                <div className="chart-label">
                  <span className="label-color" style={{backgroundColor: item.color}}></span>
                  <span className="label-text">{item.category}</span>
                  <span className="label-value">{item.count}%</span>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="chart-card">
          <h3>Rating Distribution</h3>
          <div className="chart-container">
            {ratingDistribution.map((item, index) => (
              <div key={index} className="chart-item">
                <div className="chart-bar">
                  <div 
                    className="bar-fill"
                    style={{
                      width: `${item.count}%`,
                      backgroundColor: item.color
                    }}
                  ></div>
                </div>
                <div className="chart-label">
                  <span className="label-color" style={{backgroundColor: item.color}}></span>
                  <span className="label-text">{item.rating}</span>
                  <span className="label-value">{item.count}%</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Recent Activity Summary */}
      <div className="activity-summary">
        <div className="summary-card">
          <h3>Platform Growth</h3>
          <div className="growth-stats">
            <div className="growth-item">
              <div className="growth-number">+15%</div>
              <div className="growth-label">Institutes this month</div>
            </div>
            <div className="growth-item">
              <div className="growth-number">+28%</div>
              <div className="growth-label">User registrations</div>
            </div>
            <div className="growth-item">
              <div className="growth-number">+42%</div>
              <div className="growth-label">Reviews submitted</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AnalyticsDashboard;
